import React from 'react'
import Router from './routes'
import GlobalStyle from './styles/global'
import Header from './components/Header'
import { BrowserRouter } from 'react-router-dom'


function App() {
  return (
    <BrowserRouter>
      <Header/>
      <Router />
      <GlobalStyle />
      </BrowserRouter>
  );
}

export default App;
